import TimelineChart from '../../charts/TimeLineChart'
import React, { useState } from 'react'
import { fetchStaticTimesFromAPI } from '../../../api/StaticData'

const StaticTimeLine = () => {
  const [timesData, setTimesData] = useState([])

  const handleLabelClick = async (label) => {
    const experienceId = label.split(' ')[0]
    const fetchedData = await fetchStaticTimesFromAPI(experienceId)
    setTimesData(fetchedData)
  }

  return (
    <TimelineChart
      data={timesData}
      handleLabelClick={handleLabelClick}
      onDataReceived={handleDataReceived}
      onWordDataReceived={handleWordDataReceived}
    />
  )
}

export default StaticTimeLine
